  const handleClick = (clicked) => {
    setHeaderButtonPressed(clicked)
    console.log(clicked)
  }

  return (
    <div>
      <Main handleClick={handleClick}
        headerButtonPressed={headerButtonPressed} />
    </div>
  )
}

export default App;
